// Prototypes
int terrain_main(); // Main function
void terrain_full(); // 0...Triangulate using all points
void terrain_adaptiveSimplify(); // 1...Simplify adaptively according to height tolerance
void terrain_gridSimplify(); // 2...Simplify according to the grid size
void terrain_numPointsSimplify(); // 3...Simplify according to the desired number of points
void exportData(); // 4...Export a triangulation
void getInputPoints(const std::string& filename,std::vector<Point2>& vPointsOut); // Creates input
void write(const std::string& id,const std::string& name,const Fade_2D& dt); // Writer (*.list and *.obj)
void getMountain(std::vector<Point2>& vPointsOut); // Returns a test terrain



// * main() - control
int terrain_main()
{
	std::cout<<gRed("\n\n\n+++ +++ +++ +++ +++ +++ +++")<<std::endl;
	while(true)
	{
		std::cout<<"\n\n* Fade2.5D Demo - Terrain triangulation\n"<<std::endl;

		// * 1 *   Let the user choose
		cout << "0...Terrain - Full Triangulation" << endl;
		cout << "1...Terrain - Adaptive Simplification" << endl;
		cout << "2...Terrain - Grid Simplification" << endl;
		cout << "3...Terrain - NumPoints Simplification" << endl;
		cout << "4...Export - Triangulation Data Export" << endl;
		cout << "q...quit" << endl;
		cout << "\n\nChoose an example [0-4],q: ";
		char choice(0);
		cin>>choice;
		cout<<"------------------------------\n\n";
		switch(choice)
		{
			case '0':
				cout<<"* Terrain full"<<std::endl;
				terrain_full();
				break;
			case '1':
				cout<<"* Adaptive simplify"<<std::endl;
				terrain_adaptiveSimplify();
				break;
			case '2':
				cout<<"* Grid simplify"<<std::endl;
				terrain_gridSimplify();
				break;
			case '3':
				cout<<"* NumPoints simplify"<<std::endl;
				terrain_numPointsSimplify();
				break;
			case '4':
				cout<<"* Export a triangulation"<<std::endl;
				exportData();
				break;
			case 'q':
			default:
				cout<<"Returning"<<endl;
				return 1;
		}
		cout<<"\n\nEND\n------------------------------"<<endl;
	}
}


// 0: Triangulate all points
void terrain_full()
{
	// * 1 *   Get input points
	std::vector<Point2> vInputPoints;
	getInputPoints("MOUNTAIN",vInputPoints);

	// * 2 *   Triangulate
	Fade_2D dt;
	// dt.insert(vInputPoints); // Still possible but CloudPrepare is recommended
	CloudPrepare cloudPrep;
	cloudPrep.add(vInputPoints);
	dt.insert(&cloudPrep,true); // More memory efficient

	// * 3 *   Show
	write("a0","terrain_full",dt);
}


// 1: Simplify: Adaptive, cluster points based on their height difference
void terrain_adaptiveSimplify()
{
	// * 1 *   Get input points
	std::vector<Point2> vInputPoints;
	getInputPoints("MOUNTAIN",vInputPoints);

	// * 2 *   Add them to a CloudPrepare object (or add them one by one)
	CloudPrepare cloudPrep;
	cloudPrep.add(vInputPoints);

	// * 3 *   Reduce the cloud size
	double maxDiffZ(1.0); // z-tolerance per point group
	SumStrategy sms(SMS_AVERAGE); // or SMS_MEDIAN, SMS_MINIMUM, SMS_MAXIMUM
	ConvexHullStrategy chs(CHS_MAXHULL); // or CHS_NONE, CHS_MINHULL
	// We can use dry-run=true to determine the number of points that would result:
	double aTolerance []={0.1,0.5,1.0,2.0,3.0};
	cout<<"Adaptive simplify, dry-run:"<<endl;
	for(size_t i=0;i<5;++i)
	{
		double tolerance(aTolerance[i]);
		size_t num=cloudPrep.adaptiveSimplify(tolerance,sms,chs,true); // bDryRun=true
		cout<<"* DryRun, for tolerance="<<tolerance<<" the point cloud size would be "<<num<<endl;
	}


	cloudPrep.adaptiveSimplify(maxDiffZ,sms,chs,false);// bDryRun=false
	cout<<"CloudPrepare adaptiveSimplify, numPoints reduced="<<cloudPrep.getNumPoints()<<endl;
	Fade_2D dt;
	dt.insert(&cloudPrep,true);

	// * 4 *   Show
	write("a1","terrain_adaptiveSimplify",dt);
}


// 2: Simplify: Use a grid to cluster points
void terrain_gridSimplify()
{
	// * 1 *   Get input points
	std::vector<Point2> vInputPoints;
	getInputPoints("MOUNTAIN",vInputPoints);

	// * 2 *   Add them to a CloudPrepare object (or add them one by one)
	CloudPrepare cloudPrep;
	cloudPrep.add(vInputPoints);

	// * 3 *   Reduce the cloud size
	SumStrategy sms(SMS_AVERAGE); // or SMS_MEDIAN, SMS_MINIMUM, SMS_MAXIMUM
	ConvexHullStrategy chs(CHS_MAXHULL); // or CHS_NONE, CHS_MINHULL
	// We can use dry-run=true to determine the number of points that would result:
	double aGridLength []={1.5,2.0,2.5,3.0,3.5};
	cout<<"Grid simplify, dry-run:"<<endl;
	for(size_t i=0;i<5;++i)
	{
		double gridLength(aGridLength[i]);
		size_t num=cloudPrep.uniformSimplifyGrid(gridLength,sms,chs,true); // bDryRun=true
		cout<<"* DryRun, for gridLength="<<gridLength<<" the point cloud size would be "<<num<<endl;
	}

	double gridLength(2);
	cloudPrep.uniformSimplifyGrid(gridLength,sms,chs,false); // bDryRun=false
	cout<<"CloudPrepare gridSimplify, numPoints reduced="<<cloudPrep.getNumPoints()<<endl;
	Fade_2D dt;
	dt.insert(&cloudPrep,true);

	// * 4 *   Show
	write("a2","terrain_gridSimplify",dt);
}

// 3: Simplify: Use approxNumPoints to cluster points (also grid-based)
void terrain_numPointsSimplify()
{
	// * 1 *   Get input points
	std::vector<Point2> vInputPoints;
	getInputPoints("MOUNTAIN",vInputPoints);

	// * 2 *   Add them to a CloudPrepare object (or add them one by one)
	CloudPrepare cloudPrep;
	cloudPrep.add(vInputPoints);

	// * 3 *   Reduce the cloud size
	SumStrategy sms(SMS_AVERAGE); // or SMS_MEDIAN, SMS_MINIMUM, SMS_MAXIMUM
	ConvexHullStrategy chs(CHS_MAXHULL); // or CHS_NONE, CHS_MINHULL
	int approxNumPoints(int(vInputPoints.size()/4));
	cloudPrep.uniformSimplifyNum(approxNumPoints,sms,chs);
	cout<<"CloudPrepare numPointsSimplify, numPoints reduced="<<cloudPrep.getNumPoints()<<endl;
	Fade_2D dt;
	dt.insert(&cloudPrep,true);

	// * 4 *   Show
	write("a3","terrain_numPointsSimplify",dt);

}

// 4: Export data of the triangulation
void exportData()
{
	// * 1 *   Create a small number of input points
	std::vector<Point2> vInputPoints;
	generateRandomSurfacePoints(
			5, // numPointsX
			4, // numPointsY
			1, // numCenters (waviness)
			0,0,0,100,100,50, // Bounds xmin,ymin,zmin,xmax,ymax,zmax
			vInputPoints, // Output vector
			1  // Seed
			);

	// * 2 *   Triangulate
	CloudPrepare cloudPrep;
	cloudPrep.add(vInputPoints);
	Fade_2D dt;
	dt.insert(&cloudPrep,true);

	// * 3 *   Export to a struct
	FadeExport fadeExport; // Simple struct, see "FadeExport.h"
    bool bCustomIndices(true); // To retrieve custom indices also
    bool bClear(true); // Clear memory in dt to save memory
    dt.exportTriangulation(fadeExport,bCustomIndices,bClear);

	// All triangulation data is in 'fadeExport' now and dt has
	// been cleared during the export procedure to avoid memory
	// usage peaks: dt is empty now.

	// * 4 *   Show that all data is in fadeExport
    fadeExport.print();
    fadeExport.writeObj("a4_exportTest25D.obj");

	// NOTE: You have full access to the data in the FadeExport struct
	// and you have also access to the source code because it has been
	// implemented only in the header file "FadeExport.h". Adapt it
	// to your needs. Have also a look at the similar example in the
	// examples_2D folder.
}

// Write demo output (*.list and *.obj)
void write(const std::string& id,const std::string& name,const Fade_2D& dt)
{
	std::string outName(id+"_"+name);
	dt.showGeomview((outName+".list").c_str()); // Geomview (Linux)
	cout<<gRed("Writing "+outName+".obj")<<endl;
	dt.writeObj((outName+".obj").c_str()); // Any *.obj-Viewer
}

// Read points from a file or generate test data
void getInputPoints(const std::string& filename,
					std::vector<Point2>& vPointsOut)
{
	if(filename=="MOUNTAIN")
	{
		getMountain(vPointsOut);
	}
	else if(!filename.empty())
	{
		// Read terrain points from an ASCII file
		readXYZ(filename.c_str(),vPointsOut);
	}
	else
	{
		// No file given, create a random surface for the demo
		generateRandomSurfacePoints(
			100, // numPointsX
			100, // numPointsY
			200, // numCenters (waviness)
			0,0,0,100,100,50, // Bounds xmin,ymin,zmin,xmax,ymax,zmax
			vPointsOut, // Output vector
			1  // Seed (0 is random, >0 is static)
			);
	}
	std::cout<<"Original number of points: "<<vPointsOut.size()<<endl;
}

